(90, 'C3-TKR1-A', 'PTS_DDPO_TKR_X', 1, '', '', 15, '', 'Peserta didik mempraktikan penggantian oli, kemudian membuang botol bekas oli setelah selesai ke tempat sampah. Jenis sampah yang cocok untuk botol bekas oli adalah tempat sampah...', '', '', '', 'B2', 'B3', 'Biasa', 'Organik', 'Non organik', '', '', '', '', '', '2', 2, 'A', 'Y', 'Produktif TKRO', ''),
