(86, 'C3-TKR1-A', 'PTS_DDPO_TKR_X', 1, '', '', 11, '', 'Pernyataan dibawah ini yang benar tentang motor bakar 4 langkah adalah...', '', '', '', 'Satu siklus terdapat 2 kali langkah piston, 1 keatas dan 1 kebawah dicapai dalam putaran 1 poros engkol.', 'Satu siklus terdapat 4 kali langkah piston, 2 keatas dan 2 kebawah sehingga dalam satu siklusnya tercapai dalam 2 putaran poros engkol.', 'Satu siklus terdapat 2 kali langkah piston, 2 keatas dan 2 kebawah sehingga dalam satu siklusnya tercapai dalam 2 putaran poros engkol.', 'Satu siklus terdapat 4 kali langkah piston, 3 keatas dan 1 kebawah sehingga dalam satu siklusnya tercapai dalam 2 putaran poros engkol.', 'Satu siklus terdapat 2 kali langkah piston, 1 keatas dan 1 kebawah sehingga dalam satu siklusnya tercapai dalam 2 putaran poros engkol.', '', '', '', '', '', '2', 2, 'A', 'Y', 'Produktif TKRO', ''),
(85, 'C3-TKR1-A', 'PTS_DDPO_TKR_X', 1, '', '', 10, '', 'Pengertian langkah buang yang benar bila dikaitkan dengan mekanisme kerja katu/diagram kerja katup adalah...', '', '', '', 'Piston bergerak dari TMA ke TMB, katup buang membuka beberapa derajat setelah TMB sehingga gas bekas pembakaran dapat keluar ke exhaust manifold.', 'Piston bergerak dari TMA ke TMB, katup buang masih tertutup rapat, beberapa derajat sebelum TMB katup masuk terbuka lebih awal sehingga gas bekas pembakaran dapat keluar ke exhaust manifold.', 'Piston bergerak dari TMA ke TMB, katup masuk masih tertutup rapat, beberapa derajat sebelum TMB katup buang sudah terbuka lebih awal sehingga gas bekas pembakaran dapat keluar ke exhaust manifold.', 'Piston bergerak dari TMB ke TMA, katup masuk masih tertutup rapat, beberapa derajat sebelum TMA katup buang sudah terbuka lebih awalsehingga gas bekas pembakaran dapat keluar ke exhaust manifold.', 'Piston bergerak dari TMB ke TMA, katup masuk masih tertutup rapat, beberapa derajat sebelum TMB katup buang sudah terbuka lebih awal sehingga gas bekas pembakaran dapat keluar ke exhaust manifold.', '', '', '', '', '', '5', 2, 'A', 'Y', 'Produktif TKRO', ''),
(84, 'C3-TKR1-A', 'PTS_DDPO_TKR_X', 1, '', '', 9, '', 'Syarat terjadinya pembakaran diruang bakar yang tepat adalah adanya...', '', '', '', 'Bahan bakar, kompresi dan pengapian.', 'Bahan pengapian , usaha dan kerja di ruang bakar.', 'Kompresi, pembakaran, pembilasan dan pengapian.', 'Bensin, kompor gas dan langkah hisap di ruang bakar.', 'Solar, bensin, pertamax, udara dan pengapian di ruang bakar.', '', '', '', '', '', '1', 2, 'A', 'Y', 'Produktif TKRO', ''),
