(301, 'MU-1-A', 'PTS_PAI_X', 1, '', '', 1, '', '', '', '', '1PAIKELAS10.PNG', 'Semua manusia akan kembali kepada Allah SWT.', 'Allah SWT menurunkan Taurat dan Injil sebelum Al-Qur`an.', 'Setiap umat memberikan aturan dan jalan yang berbeda-beda.', 'Allah SWT mampu menjadikan semua manusia sebagai satu umat.', 'Al-Qur`an sebagai kitab samawi terakhir yang dijamin kemurniannya.', '', '', '', '', '', '1', 2, 'A', 'Y', 'Agama', ''),
