(304, 'MU-1-A', 'PTS_PAI_X', 1, '', '', 4, '', '', '', '', '4PAIKELAS10.PNG', 'Melakukan kebaikan dengan tidak karena Allah SWT.', 'Senang kebaikannya akan diketahui oleh orang banyak.', 'Tidak mempedulikan ajakan temannya.', 'Sangat membutuhkan biaya untuk pengobatan orang tuanya.', 'Lebih dikenal sebagai siswa yang baik.', '', '', '', '', '', '1', 2, 'A', 'Y', 'Agama', ''),
