(308, 'MU-1-A', 'PTS_PAI_X', 1, '', '', 8, '', '', '', '', '8PAIKELAS10.PNG', 'Bekerja keras jika tidak cocok dengan selera.', 'Memilih pekerjaan dengan gaji setimpal.', 'Jalani apapun tugas yang diamanantkan tanpa berkeluh kesah.', 'Memilih pekerjaan yang sesuai dengan kebutuhan keluarga.', 'Bekerja keras tanpa meremehkan jenis pekerjaan yang halal.', '', '', '', '', '', '5', 2, 'A', 'Y', 'Agama', ''),
(309, 'MU-1-A', 'PTS_PAI_X', 1, '', '', 9, '', 'Orang tua yang mencari nafkah dituntut harus bekerja dengan keras, karena kerja keas merupakan salah satu bentuk akhlak utama. Melalui ilustrasi tersebut, pernyataan yang bukan merupakaan dampaknya adalah â€¦', '', '', '', 'Meningkatnya keinginan untuk mencari kehidupan yang bebas.', 'Adanya peningkatan taraf hidup dan martabat sebagai manusia.', 'Terbentuknya pribadi berdisiplin yang tinggi dalam kehidupannya.', 'Terangkatnya derajat dan martabat sebagai manusia yang beriman.', 'Memiliki tanggung jawab atas segala sesuatu yang harus ditunaikan.', '', '', '', '', '', '1', 2, 'A', 'Y', 'Agama', ''),
(310, 'MU-1-A', 'PTS_PAI_X', 1, '', '', 10, '', '', '', '', '10PAIKELAS10.PNG', 'Meluruskan nuat bahwa belajar adalah ibadah.', 'Memperbaiki kualitas dan kuantitas proses belajar.', 'Memperluas wawasan dalam segala aspek keilmuan.', 'Meraih nilai yang tinggi dengan segala cara sebagai tujuan akhir.', 'Bekerja sama dengan teman sejawat untuk meraih prestasi Lembaga.', '', '', '', '', '', '4', 2, 'A', 'Y', 'Agama', ''),
