(315, 'MU-1-A', 'PTS_PAI_X', 1, '', '', 15, '', 'Syu`abul iman atau cabang-cabang iman meliputi ajaran-ajaran yang harus diamalkan oleh umat islam. Berikut yang bukan termasuk cabang iman yang berhubungan dengan hati adalah â€¦', '', '', '', 'Mengimani adanya malaikat.', 'Mengimani rasul-rasul sebagai utusan Allah SWT.', 'Mengimani kitab-kita Allah SWT.', 'Mengimani qada dan qadar.', 'Mengucapkan kalimat tayyibah.', '', '', '', '', '', '5', 2, 'A', 'Y', 'Agama', ''),
