(317, 'MU-1-A', 'PTS_PAI_X', 1, '', '', 17, '', 'Sebagai seorang muslim selain harus mengimani syu`abul iman juga harus mengamalkannya, agar umat islam ...', '', '', '', 'Dapat mengembangkan peradaban yang spektakuler di dunia.', 'Memiliki daya saing dengan kelompok-kelompok penguasa dunia.', 'Mampu mengusai teknologi dan ilmu pengetahuan sepanjang masa.', 'Paham tentang keimanan dan selalu berbuat baik dan menghindari keburukan.', 'Tidak tertinggal oleh kebudayaan seperti kebudayaan yang datang dari barat.', '', '', '', '', '', '4', 2, 'A', 'Y', 'Agama', ''),
