(350, '', 'PTS_Bahasa-Inggris_X', 1, '', '', 25, '', '', '', '', 'XBING25.PNG', 'The varied ethnic groups in Indonesia.', 'The national motto of the country.', 'Various traditional dances.', 'Indonesia is well-known as an international tourist destination.', 'Indonesia a prime destination for those who love nature.', '', '', '', '', '', '1', 2, 'A', 'Y', '', ''),
(351, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 1, '', 'Metode ilmiah merupakan cara pemecahan masalah dengan menggunakan langkah-langkah yang telah tersusun secara sistematis. Langkah pertama dalam metode ilmiah adalah . . . .', '', '', '', 'Menyusun Hipotesis', 'Mengidentifikasi Masalah', 'Mengumpulkan Data', 'Melakukan Eksperimen', 'Menarik Kesimpulan', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(352, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 2, '', 'Dalam sebuah penelitian tentang pencemaran air, hasil pengukuran menunjukkan bahwa kadar logam berat dalam air sungai melebihi ambang batas yang ditetapkan. Langkah pertama yang harus dilakukan peserta didik dalam mengomunikasikan hasil penelitian ini adalah . . . . ', '', '', '', 'Menyusun laporan penelitian dengan data yang lengkap dan akurat', 'Melakukan pengambilan data berulang agar hasilnya sesuai teori', 'Menghentikan penelitian karena hasilnya tidak sesuai harapan', 'Mengabaikan data yang tidak sesuai dengan hipotesis', 'Mengubah data agar sesuai dengan teori yang ada', '', '', '', '', '', '1', 1, 'A', 'Y', '', ''),
(353, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 3, '', 'Seorang peserta didik melakukan pengamatan tentang pengaruh suhu terhadap proses pelarutan garam. Ia memasukkan garam sebanyak satu sendok teh ke dalam 3 gelas yang masing-masing berisi 200ml air biasa, 200 ml air es, dan 200 ml air panas. Saat garam dimasukkan, ia menyalakan stopwatch, mengaduk perlahan sebanyak 5x dan menghentikan stopwatch saat seluruh garam larut. Ia mencatat waktu yang diperlukan oleh garam tersebut untuk larut seluruhnya. Dalam percobaan tersebut, perlakuan perbedaan suhu air dengan adanya air biasa, air es, dan air panas, dikenal dengan variabel  . . . .', '', '', '', '	Bebas', 'Kontrol', 'Terikat', 'Akurat', 'Presisi', '', '', '', '', '', '1', 2, 'A', 'Y', '', ''),
