(355, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 5, '', '', '', '', '10IPAS05.PNG', 'Tumbuhan tidak dapat hidup karena membutuhkan oksigen untuk menghasilkan karbohidrat', 'Tikus tidak dapat hidup tanpa tumbuhan karena tidak mendapatkan karbondioksida', 'Tumbuhan membutuhkan karbondioksida yang dihasilkan tikus untuk fotosintesis', 'Tumbuhan membutuhkan karbondioksida yang dihasilkan tikus untuk respirasi', 'Tikus membutuhkan karbondioksida yang dihasilkan tumbuhan untuk respirasi', '', '', '', '', '', '3', 2, 'A', 'Y', '', ''),
(356, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 6, '', '', '', '', '10IPAS06.PNG', '(1), (3) dan (5)', '(3), (4) dan (5)', '(1), (4) dan (5)', '	(3), (5) dan (6)', '	(2), (4) dan (6)', '', '', '', '', '', '1', 2, 'A', 'Y', '', ''),
(357, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 7, '', 'Tiap makhluk hidup melakukan proses metabolisme dalam menjaga kelangsungan hidupnya dan mengeluarkan zat sisa di dalam tubuh melalui proses . . . .', '', '', '', 'Respirasi', 'Adaptasi', 'Ekskresi', 'Mobilitas', 'Reproduksi', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(358, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 8, '', 'Semua makhluk hidup bergerak meskipun tidak berpindah tempat. Gerak aktif terjadi karena otot-otot diperintahkan untuk bergerak oleh otak. Gerak pasif terjadi karena respons terhadap rangsang yang umumnya terjadi pada tumbuhan.  Gerak tumbuhan sebagai akibat dari perubahan kadar air dalam sel yang tidak merata disebut . . . . ', '', '', '', 'Gerak Endonom', 'Gerak Higroskopis', 'Gerak Tropisme', 'Gerak Taktis', 'Gerak Nasti', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(359, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 9, '', 'Semua populasi yang hidup bersama dalam suatu lingkungan dengan geografis dan waktu yang sama, saling berinteraksi, dan mempengaruhi satu sama lain disebut . . . .', '', '', '', 'Ekosistem', 'Komunitas', 'Biosfer', 'Autotrof', 'Heterotrof', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(360, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 10, '', '', '', '', '10IPAS10.PNG', 'Adi dan Rika', 'Anis dan Adi', 'Rika dan Anis', 'Anis dan Bayu', 'Bayu dan Rika ', '', '', '', '', '', '4', 1, 'A', 'Y', '', ''),
(361, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 11, '', '', '', '', '10IPAS11.PNG', '48', '44', '38', '34', '30', '', '', '', '', '', '1', 2, 'A', 'Y', '', ''),
(362, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 12, '', 'Komponen abiotik yang tidak mempengaruhi kehidupan makhluk hidup di lingkungan adalah . . .  .', '', '', '', 'Suhu', 'Cahaya matahari', 'Batuan', 'Mikroorganisme', 'Tanah', '', '', '', '', '', '4', 2, 'A', 'Y', '', ''),
(363, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 13, '', 'Di dalam ekosistem terjadi aliran energi. Energi tersebut akan berpindah dari tingkat trofik rendah ke tingkat trofik selanjutnya. Proses pemindahan energi terjadi melalui peristiwa . . . .', '', '', '', 'Bergerak', 'Respirasi', 'Fotosintesis', 'Metabolisme', 'Makan dan dimakan', '', '', '', '', '', '5', 1, 'A', 'Y', '', ''),
(364, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 14, '', 'Dalam ekosistem hutan, terdapat berbagai jenis tumbuhan, hewan, dan mikroorganisme yang saling bergantung satu sama lain. Salah satu contoh interaksi yang terjadi di hutan ini adalah hubungan antara bunga dan lebah. Lebah mendapatkan nektar dari bunga yang digunakan sebagai makanan, sementara bunga mendapatkan keuntungan dari proses penyerbukan yang dilakukan oleh lebah. Berdasarkan narasi di atas, identifikasikan hubungan antara Bunga dan lebah dalam ekosistem hutan tersebut . . . . .', '', '', '', 'Hubungan predator-mangsa', 'Simbiosis mutualisme ', 'Simbiosis parasitisme ', '	Komensalisme', 'Kompetisi', '', '', '', '', '', '2', 3, 'A', 'Y', '', ''),
(365, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 15, '', '', '', '', '10IPAS15.PNG', 'Predasi', 'Kompetisi', 'Netralisme', 'Parasitisme', 'Komensalisme', '', '', '', '', '', '4', 3, 'A', 'Y', '', ''),
(366, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 16, '', '', '', '', '10IPAS16.PNG', '(1),(2),dan (3)', '(1),(3),dan (2)', '(2),(1),dan (3)', '(2),(3),dan (1)', '(3),(1),dan (2)', '', '', '', '', '', '3', 3, 'A', 'Y', '', ''),
(367, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 17, '', '', '', '', '10IPAS17.PNG', 'Peningkatan jumlah populasi ular', 'Penurunan jumlah populasi rumput', 'Peningkatan jumlah populasi katak dan ular', 'Penurunan jumlah populasi rumput dan peningkatan populasi katak', 'Peningkatan populasi rumput dan penurunan populasi katak', '', '', '', '', '', '5', 2, 'A', 'Y', '', ''),
(368, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 18, '', '', '', '', '10IPAS18.PNG', 'Tumbuhan, laba laba, dan elang', 'Tumbuhan, tikus, dan rubah', 'Burung pemakan biji, Ular, Elang', 'Tikus, rubah, dan elang', 'Belalang, Laba-laba, Burung Pemakan Biji', '', '', '', '', '', '3', 3, 'A', 'Y', '', ''),
(369, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 19, '', '', '', '', '10IPAS19.PNG', 'Meningkatkan penangkapan gajah sumatra untuk keperluan penelitian dan konservasi', 'Memindahkan populasi gajah sumatra ke habitat lain di luar provinsi Aceh', 'Bekerjasama dengan pemerintah dalam melestarikan gajah sumatra', 'Menggalakkan penanaman pohon atau reboisasi untuk habitat gajah yang baru', 'Mengadakan kampanye publik untuk mengubah perilaku masyarakat yang melakukan perluasan lahan yang tidak bertanggung jawab', '', '', '', '', '', '5', 3, 'A', 'Y', '', ''),
(370, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 20, '', 'Di sebuah ekosistem, terdapat hubungan mutualisme antara pohon dan semut. Pohon menyediakan tempat tinggal dan makanan bagi semut, sementara semut melindungi pohon dari serangan hama. Jika populasi semut dalam ekosistem tersebut menurun drastis akibat penggunaan insektisida, apa dampak jangka panjang yang mungkin terjadi pada pohon dan ekosistem secara keseluruhan?', '', '', '', 'Pohon akan tumbuh lebih cepat karena tidak ada semut yang mengganggu', 'Pohon akan lebih rentan terhadap serangan hama, yang dapat mengakibatkan penurunan kesehatan pohon dan perubahan dalam struktur ekosistem', 'Tidak ada pengaruh yang signifikan terhadap pohon karena pohon dapat bertahan tanpa bantuan semut', 'Populasi hama akan menurun karena tidak ada semut yang membantu menyebarkan hama tersebut', 'Ekosistem akan menjadi lebih stabil karena berkurangnya interaksi antara semut dan pohon', '', '', '', '', '', '2', 3, 'A', 'Y', '', ''),
(371, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 21, '', 'Pada saat jam istirahat, kamu sedang berkeliling mencari temanmu dan melihat tempat sampah yang penuh dengan sampah plastik bungkus makanan dan minuman. Melihat fenomena itu, kamu memiliki ide untuk mengajukan program lingkungan untuk sekolahmu yang bertujuan mengurangi pencemaran. Program yang sesuai dengan kondisi sekolah yang akan kamu ajukan adalah . . . .', '', '', '', 'Program daur ulang sampah, memisahkan sampah organik dan anorganik serta workshop kreasi dari bahan daur ulang', 'Program penghematan listrik, dengan mematikan lampu dan alat elektronik saat tidak digunakan', 'Program jumat bersih, membersihkan selokan dan pengecekan tanaman yang ada di sekolah', 'Program penggunaan air bersih, dengan mengurangi penggunaan air saat mencuci tangan', 'Program penghijauan, dengan menanam 100 pohon di sekitar sekolah', '', '', '', '', '', '1', 3, 'A', 'Y', '', ''),
(372, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 22, '', 'Contoh tindakan sederhana yang dapat dilakukan untuk mengurangi pencemaran lingkungan di sekolah adalah . . . . .', '', '', '', 'Membakar sampah di halaman sekolah', 'Mengurangi penggunaan plastik sekali pakai', 'Menggunakan kendaraan bermotor untuk jarak dekat', 'Menggunakan bahan kimia berbahaya untuk pembersihan', 'Menanam tanaman buah yang berdahan rimbun di gazebo', '', '', '', '', '', '2', 2, 'A', 'Y', '', ''),
(373, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 23, '', 'Sebuah sungai di dekat kawasan industri mengalami penurunan kualitas air yang drastis. Setelah diteliti lebih lanjut, ditemukan bahwa pabrik di dekat danau tersebut membuang limbah berbahaya ke dalam air. Bagaimana kamu menilai tindakan pabrik tersebut?', '', '', '', 'Tindakan pabrik tersebut salah karena membangun pabrik di dekat pemukiman penduduk', 'Tindakan pabrik dapat diterima karena mendukung ekonomi lokal dan kesejahteraan warga', 'Tindakan pabrik tersebut salah karena merusak ekosistem danau dan membahayakan kehidupan ikan', 'Tindakan pabrik tersebut tidak berdampak signifikan terhadap lingkungan dan mobilitas penduduk', 'Tindakan pabrik tersebut bermanfaat karena menciptakan lapangan kerja dan mengurangi pengangguran', '', '', '', '', '', '3', 3, 'A', 'Y', '', ''),
(374, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 24, '', 'Salah satu penyebab pencemaran tanah adalah akibat penggunaan pestisida yang berlebihan. Cara efektif yang dapat dilakukan untuk mengurangi pencemaran tanah akibat pestisida misalnya . . . .', '', '', '', 'Menggunakan pestisida dengan dosis yang lebih tinggi', 'Menggunakan pestisida sintetis secara terus-menerus', 'Menggunakan pestisida alami atau biopestisida', '	Menggunakan lebih banyak pupuk kimia', 'Mengabaikan rotasi tanaman', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(375, 'MK-4-A', 'PTS_PROJEK_IPAS_X', 1, '', '', 25, '', 'Diketahui bahwa pencemaran udara dapat disebabkan oleh aktivitas manusia. Salah satu sumber pencemaran udara adalah transportasi. Transportasi menghasilkan gas buang yang mengandung karbon monoksida (CO). Dampak karbon monoksida terhadap kesehatan manusia adalah . . . .', '', '', '', 'Menyebabkan iritasi kulit', 'Menyebabkan gangguan pencernaan', 'Mengurangi kemampuan darah mengikat oksigen', 'Menurunkan imunitas tubuh', 'Menyebabkan kerusakan jaringan otot', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
