(991, 'B3-B', 'PTS_PKK_XI', 1, '', '', 1, '', 'Secara umum, kekayaan intelektual dapat dikatakan sebagai hak kekayaan yang tumbuh dari intelektual manusia. Kekayaan intelektual mencakup dua katagori, yaitu hak cipta dan hak kekayaan industry yang mana hak cipta dan hak kekayaan industry tersebut dilindungi dan di atur dalam aturan-aturan aturan-aturan tersebut adalah berupa â€¦.. ?', '', '', '', 'Hukum Adat', 'Peraturan perundang-undangan', 'Peratura wilayah', 'Peratura Kepala Negara', 'Peraturan khusus kinerja para pegawai', '', '', '', '', '', '2', 2, 'A', 'Y', '', ''),
(992, 'B3-B', 'PTS_PKK_XI', 1, '', '', 2, '', 'Penetapan dan perlindungan kekayaan Intelektual telah diatur didalam Undang-undang, oleh karena itu, barang siapa yang melakukan pembajakan atau mengakui atas kekayaan orang lain akan mendapatkan sangsi dan hukuman pidana. Dasar hukum kekayaan intelektual di Indonesia diatur dalam berbagai payung hukum berupa â€¦.', '', '', '', 'Undang-undang atau pun surat-surat edaran', 'Peraturan Pemerintah, Peraturan Mentri', 'Peraturan Presiden, dan Keputusan Presiden', 'A, B, dan C  Salah', 'A, B, dan C Benar', '', '', '', '', '', '5', 2, 'A', 'Y', '', ''),
(993, 'B3-B', 'PTS_PKK_XI', 1, '', '', 3, '', '', '', '', 'PKK_11_Soal 3.png', 'Undang-undang  Nomor 30 Tahun 2000 yang mengatur tentang Hak Rahasia dagang', 'Undang-undang  Nomor 28 Tahun 2014 yang mengatur tentang Hak Cipta', 'Undang-undang  Nomor 31 Tahun 2000 yang mengatur tentang Desain Industri ', 'Undang-undang Nomor 13 Tahun 2016 yang mengatur tentang Hak Paten', 'Undang-undang  Nomor 20 Tahun 2016 yang mengatur tentang Hak Merek', '', '', '', '', '', '3', 2, 'A', 'Y', '', ''),
(994, 'B3-B', 'PTS_PKK_XI', 1, '', '', 4, '', 'Prosedur permohonan dan pencatatan Permohonan perjanjian lisensi dilakukan oleh pemohon dan diajukan secara tertulis kepada mentri yang data-data Pengirimannya tersebut pada saat ini adalah secara ekektronik maupu non elektronik. Dokumen-dokumen yang harus dilampirkan adalah dibawah ini adalah dokumen yang tidak termasuk kedalam surat-surat yang harus dikirim kan adalah â€¦.? ', '', '', '', 'Secara ekektronik ', 'Secara Non elektronik', 'Secara Langsung Datang ke Kementiran', 'Jawaban A dan B Salah', 'Jawaban A dan B Benar ', '', '', '', '', '', '5', 2, 'A', 'Y', '', ''),
(995, 'B3-B', 'PTS_PKK_XI', 1, '', '', 5, '', 'Prosedur permohonan dan pencatatan Permohonan perjanjian lisensi dilakukan oleh pemohon dan diajukan secara tertulis kepada mentri yang datanya,  di kirimkan secara ekektronik maupu non elektronik. Dokumen-dokumen yang harus dilampirkan adalah dibawah ini adalah dokumen yang tidak termasuk kedalam surta-surat yang harus dikirim kan adalah â€¦.? ', '', '', '', 'Salinan perjanjian lisensi atau bukti perjanjian lisensi              ', 'Salinan atau petikan sertifikat paten, merek, deain industry, desain tata letak sirkuit terpadu ', 'Hak terkait dan rahasia dagang yang dilisensikan masih berlaku.', 'Bukti kepemilikan hak cipta, hak terkait dan rahasia dagang yang dilisensikan masih berlaku.', 'Kegiatan Pengendalian Perusahaan', '', '', '', '', '', '5', 2, 'A', 'Y', '', ''),
(996, 'B3-B', 'PTS_PKK_XI', 1, '', '', 6, '', 'Suatu karya intelektual yang terdapat di dalam masyarakat tradisional secara turun temurun dan apabila tidak dipertahankan dikhawatirkan akan punah dan apabila itu terjadi akan merupakan kerugian bagi khasanah pengetahuan manusia pada umumnya, atau dikhawatirkan akan dimanfaatkan secara tidak sah dan tidak adil oleh pihak-pihak di luar pemiliknya. Karya seni Intelektual tradisional ini biasa dikenal dengan sebutannya adalah â€¦.', '', '', '', 'Musik, tarian, drama seni', 'â€œFolkloreâ€ dan â€œTraditional Knowledgeâ€ ', 'kerajinan tangan, seni pahat, seni lukis', 'karya sastra dan sarana', 'Tidak satupun jawaban yang benar', '', '', '', '', '', '2', 2, 'A', 'Y', '', ''),
(997, 'B3-B', 'PTS_PKK_XI', 1, '', '', 7, '', 'Proposal dibuat memang ditujukan sebagai pengajuan rencana kegiatan yang jelas dan detail supaya mendapat persetujuan. Di dalam proposal biasanya juga sudah ditampilkan secara rinci dana yang akan dibutuhkan. Baik di dunia kerja maupun dunia  pendidikan, proposal ini amat penting dipelajari. Sebab dalam setiap kegiatan pasti akan membutuhkan proposal. Ada beberapa pendapat para ahli pengertian tentang Proposal diantaranya adalah â€œProposal merupakan rencana yang telah disusun untuk sebuah kegiatan.â€ Ini adala Pendapat Ahli Menurut â€¦.', '', '', '', 'Keraf ', 'Hadi', 'Hasnun Anwar ', 'Lay ', 'Riefky', '', '', '', '', '', '3', 2, 'A', 'Y', '', ''),
(998, 'B3-B', 'PTS_PKK_XI', 1, '', '', 8, '', 'Proposal yang biasanya digunakan oleh mereka yang berada di lingkunganÂ Â pendidikan/akademis biasanya lebih banyak dibuat oleh para mahasiswa atau dosen. Proposal ini terdiri dari proposal untuk kebutuhan: Disertasi, Tesis, Skripsi, atau yang lainnya. Proposal ini dibuat ketika seseorang hendak melakukan sebuah penelitian. Sehingga apa yang hendak diteliti dan bagaimana prosedur penelitian serta teori yang dipakai akan dijelaskan dalam proposal. Tentu saja bagi mereka yang hendak melaksanakan sebuah penelitian, proposal menjadi gerbang utamanya. Jenis proposal tersebut desebut sebagai Proposal â€¦.?', '', '', '', 'Proposal usaha', 'Proposal penelitian', 'Proposal kegiatan', 'Proposal bisnis', 'Proposal proyek', '', '', '', '', '', '2', 2, 'A', 'Y', '', ''),
(999, 'B3-B', 'PTS_PKK_XI', 1, '', '', 9, '', 'Setiap Hasil karya intelektual yang akan/dapat dipatenkan haruslah Hasil karya yang  â€¦.?', '', '', '', 'Bersifat Sementara', 'Sudah pernah dipamerkan', 'Dirancang/Disain', 'Intelektual belum pernah dipublikasikan ', 'Diberi hak paten', '', '', '', '', '', '4', 2, 'A', 'Y', '', ''),
(1000, 'B3-B', 'PTS_PKK_XI', 1, '', '', 10, '', 'Permohonan pencatatan oleh warga Negara Asing atau objek permohonan pencatatan perjanjian lisensi milik warga Negara Asing maka permohonan pelaksanaan wajib dilakukan oleh konsultan kekayaan intelektual yang berdomisili di Indonesia. Jangka waktu pencatatan perjanjian lisensi berlaku untuk jangka waktu berapa tahun â€¦. ? ', '', '', '', '3 Tahun\n', ' \n10 bulan \n. ', ' \n10 Hari', '\n.\n5 Tahun \n', ' \n10 Tahun', '', '', '', '', '', '4', 1, 'A', 'Y', '', ''),
(1001, 'B3-B', 'PTS_PKK_XI', 1, '', '', 11, '', 'Beberapa ahli memang mendefinisikan proposal secara berbeda-beda. Namun pada intinya, dapat disimpulkan bahwa proposal adalah sebuah agenda kerja terstruktur yang tertulis dengan susunan tertentu,  sebagai sebuah acuan ataupun ajuan untuk melaksanakan suatu ....', '', '', '', 'Rencana\n', 'Suatu kegiatan atau pekerjaan.\n', 'Program\n', 'Legalitas\n', 'Biaya', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(1002, 'B3-B', 'PTS_PKK_XI', 1, '', '', 12, '', '', '', '', 'PKK_11_Soal 12.png', '(1), (3), (2)\n', '\n(2), (3), (1)\n', '(1), (4), (5)\n', '(1), (2), (3), (4), (5)  \n', '(4), (5), (6) ', '', '', '', '', '', '4', 1, 'A', 'Y', '', ''),
(1003, 'B3-B', 'PTS_PKK_XI', 1, '', '', 13, '', 'Proposal yang menjelaskan gambaran mengenai bagaimana usaha dan bisnis akan dijalankan. Dengan adanya proposal ini diharapkan setiap pihak yang terlibat sudah mempunyai gambaran mengenai seluk beluk usaha yang hendak dijalankan, baik dari segi kebutuhan maupun analisis keuntungan finansialnya. Jenis Proposal ini disebut Proposal â€¦..?                              ', '', '', '', 'Poposal kegiatan\n', ' \nProposal usaha atau bisnis \n', 'Proposal penelitian\n', 'Poposal proyek\n', '	Poposal Bisnis', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(1004, 'B3-B', 'PTS_PKK_XI', 1, '', '', 14, '', 'Jenis Proposal yang memiliki struktur yang baku, dan harus ada di setiap proposal. Bahasa yang dipakai juga menggunakan bahasa Indonesia yang baku. Ada tiga bagian utama yang biasanya digunakan untuk menyusun proposal tersebut, yaitu Pendahuluan, Isi, dan Data Pelengkap Proposal. Jenis Proposal ini disebut â€¦. ?', '', '', '', 'Proposal Semi Formal\n', 'Proposal Non Formal\n', 'Proposal Formal\n', 'Proposal Bisnis/Usaha\n', 'Proposal Proyek', '', '', '', '', '', '3', 1, 'A', 'Y', '', '');
