(1006, 'B3-B', 'PTS_PKK_XI', 1, '', '', 16, '', 'Proposal merupakan usulan kegiatan yang dituangkan dalam bentuk tulisan berisi rancangan kegiatan yang rinci dan ditulis secara sistematis. Kata proposal dalam bahasa Inggris yaitu â€œto porposeâ€, arti dari kata â€œto porposeâ€ adalah â€¦. ?', '', '', '', 'Menghitung\n', 'Mengajukan\n', 'Meneliti\n', 'Memasarkan\n', 'Proses Penjualan', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(1007, 'B3-B', 'PTS_PKK_XI', 1, '', '', 17, '', 'Lokasi secara umum, untuk seorang wirausaha ada dua hal yang harus diperhatikan dalam menentukan lokasi usahanya, yaitu pertalian ke belakang (backward linkage) yaitu perolehan bahan baku dan pertalian ke depan (forward linkage), maksud atau arti forward linkage adalah  â€¦.?', '', '', '', 'Penjualan, distribusi dan pemasaran produk \n', 'Kedekatan dengan sumber bahan baku produksi', 'Rancangan produk', 'Ketersediaan kemudahan untuk mendapatkan tenaga kerja \n', 'Sikap/peraturan pemerintah serta masyarakat sekitar ', '', '', '', '', '', '1', 1, 'A', 'Y', '', ''),
(1008, 'B3-B', 'PTS_PKK_XI', 1, '', '', 18, '', 'Wirausahawan yang baik sesalalu mempertimbangkan didalam memilih produk-produk yang akan di produksi atau pun dipasarkan, untuk itu hal-hal yang harus dipertimbangkan oleh seorang wirausahawan dalam memilih produknya  adalah â€¦.', '', '', '', 'Permintaan Konsumen akan Suatub Produk \n', 'Konsumen yang belum Teridentifikasi. \n', 'Persaingan Pasar dan atau Sumber daya yang menunjang pembuatan Produk\n', 'Jawaban A, B, dan  C Benar\n', 'Jawaban A, B, dan C Salah', '', '', '', '', '', '4', 1, 'A', 'Y', '', ''),
(1009, 'B3-B', 'PTS_PKK_XI', 1, '', '', 19, '', 'Proposal usaha biasanya digunakan untuk memperoleh modal usaha. Oleh karena itu, Seorang wirausaha harus membuat proposal yang berisi informasi-informasi yang lengkap tentang hal-hal yang sedang atau akan dijalankan, serta kebutuhan modal yang diperlukan. Berdasarkan proposal tersebut, pihak lembaga keuangan (disini biasanya Perbankan) akan menilai apakah wirausaha tersebut layak memperoleh pinjaman atau tidak. Informasi yang biasanya tercantum dalam sebuah proposal usaha, antara lain adalah ... ?', '', '', '', 'Rekayasa  Produk\n', 'Jumlah Produk yang dibuat\n', 'Prototipe Produk\n', 'Seberapa Besar Bunga Bank\n', 'ANALISIS  SWOT', '', '', '', '', '', '5', 1, 'A', 'Y', '', ''),
