(1011, 'B3-B', 'PTS_PKK_XI', 1, '', '', 21, '', 'Faktor-faktor penyusunan Proposal usaha harus disusun dengan mempertimbangkan, hal-hal berikut, Tujuan harus realistis. Tujuan yang ingin dicapai harus spesifik, dapat dicapai dan diukur, serta ada kesamaan waktu dan parameter pengukurannya. Fleksibel/luwes Kondisi lingkungan usaha selalu berubah/dinamis, sehingga penyusunan proposal pun harus fleksibel. Jadi di dalam pembuatan Proposal harus bersifat Fleksibel, Arti dari fleksibel, adalah â€¦.', '', '', '', 'Proposal tersebut harus dapat menyesuaikan dengan perkembangan usaha\n', 'Jawaban A dan C Benar\n', 'Tegas, jelas tidak berbelit-belit\n', ' Jawaban A dan C Salah.\n', 'Disusun Manajemen.', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(1012, 'B3-B', 'PTS_PKK_XI', 1, '', '', 22, '', 'Fungsi proposal Usaha, Proposal usaha memiliki arti penting bagi wirausaha sebagai pernyataan atau regitimasi (pengakuan dari Masyarakat) Calon wirausaha sebagai pemilik dan pemegang inisiatif dalam membuka usaha. Selain itu, proposal usaha berfungsi sebagai. (Salah satunya fungsi Proposal usahanya ) adalah â€¦.', '', '', '', 'Menjual Produk \n', 'Memberikan gambaran kepada pihak lain tentang profil perusahaan  \n', 'Harga dan volume Produk', 'Bertanggung jawab pada produk.\n', 'Standar dan Spesifikasi desain.', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
