(1031, 'MN-1-C', 'PTS_PAI_XII', 1, '', '', 16, '', '', '', '', 'soal no16.png', 'Orang-orang kafir selalu mengingkari risalah dakwah para Nabi', 'Sebagian umat terdahulu meragukan keabsahan para Nabi yang diutus Allah swt', 'Para Nabi yang ditus membawa membawa buikti yang nyata berupa mukzizat', 'Sebagian umat islam mengingkari ajaran islam yang telah dibawa oleh para Nabi.', 'Hanya Allah swt yang mengetahui jumlah umat  terdahulu yang ingkar terhadap ajaran islam.', '', '', '', '', '', '2', 2, 'A', 'Y', '', ''),
(1032, 'MN-1-C', 'PTS_PAI_XII', 1, '', '', 17, '', '', '', '', 'soal no17.png', 'Makin besar ujian yang di turunkan allah swt semakin  besar pula resikinya.', 'Semakin besar ujian yang ditimpakan semakin besar pula pahala nya..', 'Semakinn tinggi derjat seseorang semakin besar pulaujian yang didapatnya', 'Ujian yang diberikan oleh Allah adalah peluan untuk menghapus dosa', 'Ujian yang dating dari Allah disesuaikan dengan lemampuan hambanya', '', '', '', '', '', '3', 2, 'A', 'Y', '', ''),
(1033, 'MN-1-C', 'PTS_PAI_XII', 1, '', '', 18, '', '', '', '', 'soal no18.png', 'Tidak pernah mempedulikan setiap musibah yang menimpa', 'Berharap mendapatkan musibah yang berat dari Allah swt.', 'Menukmati setiap ujian yang ditimpakan Allah.', 'Memohon kesembuhan penyakit dari Allah swt  dan berobat ke dokter', 'Rela dengan penyakit yang ditimpakan Allh swt  sambil terus berdoa', '', '', '', '', '', '4', 2, 'A', 'Y', '', ''),
