(1035, 'MN-1-C', 'PTS_PAI_XII', 1, '', '', 20, '', 'Perhatikan terjemahan ayat berikut :â€ Apakah belum sampai kepadamu berita orang-orang sebelum kamu (yaitu) kaum Nuh, `Ä€d, Samud dan orang-orang setelah mereka. Tidak ada yang mengetahui mereka selain Allah. Rasul-rasul telah datang kepada mereka membawa bukti-bukti (yang nyata), namun mereka menutupkan tangannya ke mulutnya (karena kebencian), dan berkata, "Sesungguhnya kami tidak percaya akan (bukti bahwa) kamu diutus (kepada kami), dan kami benar-benar dalam keraguan yang menggelisahkan terhadap apa yang kamu serukan kepada kami."  Sikap yang tidak sejalan dengan kandungan terjemahan ayat diatas adalah â€¦', '', '', '', 'Bersabar dalam menghadapi ujian yang merintangi jalan dakwah', 'Menggunakan metode mutakhir dalam dakwah agar menarik minat masyarakat', 'Selalu mengambil Pelajaran dari umat terdahulu untuk  diterapkan pada masa kini', 'Berusaha membekali diri dengan wawasan keilmuan dan berdakwah sesuai perkembangan zaman', 'Bertawakal kepada Allh swt ntuk menjalankan tugas pendakwah yang menyampaikan kebenaran.', '', '', '', '', '', '2', 2, 'A', 'Y', '', ''),
(1036, 'MN-1-C', 'PTS_PAI_XII', 1, '', '', 21, '', 'Iman , islam dan ihsan merupakan inti dari ajaran agamaislam, yang menjadi kesatua yang utuh yang tidak dapat dipisahkan  antara satu dengan yang lain nya . Pernyataan berikut yang termasuk pengertian dari iman adalah ....', '', '', '', 'Menerima dengan puas  serta pasrah terhadap ketentuan dan hukum-hukum Allah swt', 'Membenarkan  keberadaan Allah swt dengan melakukan perbuatan yang baik', 'Keyakinan kepada Allah swt cukup dirasakan dalam hati saja.', 'Sikap untuk selalu melakukan kebaikan dan menahan diri dari keburukan', 'Meyakini dengan hati di ucapkan dengan lisan dan buktikan dengan perbuatan.', '', '', '', '', '', '4', 2, 'A', 'Y', '', ''),
(1037, 'MN-1-C', 'PTS_PAI_XII', 1, '', '', 22, '', 'Kata islam berasal dari Bahasa arab yaitu  aslama- yuslimu yang berarti tunduk dan patuh. Sedang menurut istilah , berikut ini yang termasuk makna dari islam adalah â€¦.', '', '', '', 'Membenarkan  keberadaan Allah swt dengan melakukan perbuatan yang baik', 'Mnerima dengan puas  serta pasrah terhadap ketentuan dan hukum-hukum Allah swt', 'Meyakini dengan hati di ucapkan dengan lisan dan buktikan dengan perbuatan ', 'Meyakini dengan hati di ucapkan dengan lisan dan buktikan dengan perbuatan.', 'Keyakinan kepada Allah swt cukup dirasakan dalam hati saja', '', '', '', '', '', '1', 2, 'A', 'Y', '', ''),
