(1039, 'MN-1-C', 'PTS_PAI_XII', 1, '', '', 24, '', 'Perhatikan terjemahan hadis Riwayat Imam Bukhari Berikut: â€œAbu Hursirsh berkta: â€œ Nabi saw, pada suati hari berada ditengah-tangah para sahabat, lalu dating malaikat jibril dan kemudian bertanya: â€¦ â€œ apakah ihsan itu ? â€œNabi saw menjawab: kamu menyembah Allh seolah-olah melihatnya,  dan apabila tidak mampu melihatnya , bahwa sesungguhnya Dia melihatmu.â€ (H.R bukhari). Pernyataan berikut yang tidak sesuai dengan makna hadis diatas adalah â€¦', '', '', '', 'Selalalu menebarkan kebaikan dengan ihklas tampa ada niat untuk ria', 'Tetap  melaksanakan ibadah walaupun tidak dapat merasakan kehadiran Allah swt', 'Allah swt  menyaksikan seluruh ibadah hamba-hamba nya karena Allh Maha melihat.', 'Hakikat ihsan adalah beribadah kepada Allah swt dengan merasakan kehadiran Allah walaupun tidak bisa melihat Allah swt', 'Ketika beribadah shalat sebaiknya dalam kondisi mata terbuka sehingga dapat melihat Allah dengan jelas', '', '', '', '', '', '5', 2, 'A', 'Y', '', ''),
