(1068, 'MN-3-C', 'PTS_B-Indonesia_XII', 1, '', '', 3, '', 'Berikut yang bukan termasuk ciri berita adalah . . . .', '', '', '', 'Stuktur bahasa tepat dan mudah di mengerti', 'Diksi tepat dan tidak ambigu', 'Menarik perhatian', 'Terurai panjang', 'Bahasa segar dan hidup', '', '', '', '', '', '4', 1, 'A', 'Y', '', ''),
(1069, 'MN-3-C', 'PTS_B-Indonesia_XII', 1, '', '', 4, '', '', '', '', 'BindoPAS124.PNG', 'Manajemen SFC mendapatkan Budi Sudarsono.', 'Harga kontrak tidak disepakati SFC dan Budi Sudarsono.', 'Budi Sudarsono akan dikontrak SFC setengah musim.', 'Budi Sudarsono telah menandatangani kontrak dengan SFC.', 'Usaha manajemen SFC mendapatkan striker.', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(1070, 'MN-3-C', 'PTS_B-Indonesia_XII', 1, '', '', 5, '', '', '', '', 'BindoPAS125.PNG', 'Karya-karya Deddy Mizwar muncul dalam layar kaca.', 'Para Pencari Tuhan menempati rating tertinggi.', 'Karya Deddy Mizwar selalu mendapat kritikan masyarakat.', 'Animo masyarakat untuk menonton film di gedung bioskop tidak banyak.', 'Karya-karya Deddy Mizwar selalu menjadi tontonan.', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(1071, 'MN-3-C', 'PTS_B-Indonesia_XII', 1, '', '', 6, '', '', '', '', 'BindoPAS126.PNG', 'Saat ini Adriano tetap menjadi pemain di Inter Milan.', 'Adriano dikenal kembali setelah kemenangan Flamengo di Liga Brasil.', 'Adriano langsung menerima tawaran dari sejumlah klub di Eropa.', 'Flamengo telah beberapa kali memenangkan kejuaraan di Eropa dan Amerika.', 'Adriano tidak pernah bermain di Inter Milian.', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(1072, 'MN-3-C', 'PTS_B-Indonesia_XII', 1, '', '', 7, '', '', '', '', 'BindoPAS127.PNG', '(1)', '(2)', '(3)', '(4)', 'Tidak ada kalimat utama', '', '', '', '', '', '1', 1, 'A', 'Y', '', ''),
(1073, 'MN-3-C', 'PTS_B-Indonesia_XII', 1, '', '', 8, '', '', '', '', 'BindoPAS128.PNG', 'tujuan survei satwa endemik Sulawesi', 'survei satwa endemik Sulawesi', 'metode survei satwa endemik', 'tempat survei satwa endemik', 'jenis satwa endemik', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(1074, 'MN-3-C', 'PTS_B-Indonesia_XII', 1, '', '', 9, '', '', '', '', 'BindoPAS129.PNG', 'Musim kemarau yang cukup panjang terjadi di tahun ini.', 'Para peternak sapi potong mulai resah karena kesulitan memperoleh rumput.', 'Kekurangan air menyebabkan rumput meranggas.', 'Jumlah populasi sapi potong semakin menurun.', 'Ladang rumput semakin berkurang karena kekurangan air.', '', '', '', '', '', '2', 1, 'A', 'Y', '', ''),
(1075, 'MN-3-C', 'PTS_B-Indonesia_XII', 1, '', '', 10, '', '', '', '', 'BindoPAS1210.PNG', 'Pemetaan terhadap pencapaian belajar siswa.', 'Kelulusan siswa ditentukan oleh sekolah terkait.', 'Imbauan menjadikan UN sebagai moment ketika ingin selfie.', 'Ajakan menghilangkan rasa takut menghadapi UN.', 'Imbauan menciptakan suasana riang menghadapi UN.', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(1076, 'MN-3-C', 'PTS_B-Indonesia_XII', 1, '', '', 11, '', '', '', '', 'BindoPAS1211.PNG', 'Siswa takut menghadapi UN disebabkan banyak faktor, terutama tuntutan untuk mendapat nilai bagus.', 'Jika siswa mencapai nilai UN rendah pihak sekolah akan mendapat peringatan dari dinas pendidikan terkait.', 'UN tidak penting bagi siswa SMA karena nilai UN tidak bisa digunakan untuk mendaftar ke perguruan tinggi.', 'Berita UN bukan penentu kelulusan memberi angin segar bagi siswa yang malas belajar.', 'Beban sekolah semakin berat karena harus memutuskan kelulusan dan ketidaklulusan siswanya.', '', '', '', '', '', '1', 1, 'A', 'Y', '', ''),
(1077, 'MN-3-C', 'PTS_B-Indonesia_XII', 1, '', '', 12, '', '', '', '', 'BindoPAS1212.PNG', 'Kamis (29/1/2015), Kepala Pusat Penilaian Pendidikan Kemendikbud, Nizam melakukan program â€œTrending Topic Metro TVâ€. Dalam kesempatan tersebut, Nizam mengajak semua siswa untuk melakukan selfie sebelum UN. Beliau menambahkan bahwa saat ini UN bukan penentu kelulusan. UN hanya digunakan sebagai alat ukur pencapaian siswa.', 'Saat ini faktor penentu kelulusan tidak ditentukan oleh nilai UN semata. Pihak sekolah berhak sepenuhnya menentukan kelulusan siswanya. Jadi, siswa diharapkan tidak takut dengan UN. Informasi tersebut disampaikan Menteri Pendidikan dan Kebudayaan dalam program â€œTrending Topic Metro TVâ€, Kamis (29/1/2015).', 'Ketakutan siswa dengan UN sudah berlangsung sejak lama. Siswa takut jika mendapat nilai UN rendah dan dinyatakan tidak lulus. Kini ketakutan itu sirna setelah ada keputusan dari Menteri Pendidikan dan Kebudayaan dalam program â€œTrending Topic Metro TVâ€, Kamis (29/1/2015).', 'Dalam program â€œTrending Topic Metro TVâ€, Kamis (29/1/2015), Nizam mengatakan semua siswa Indonesia untuk mengerjakan Un dengan semangat. Nizam mengimbau semua siswa agar tidak terpengaruh jual beli naskah UN. Nizam menambahkan bahwa saat ini UN bukan penentu kelulusan. UN hanya digunakan sebagai alat ukur pencapaian siswa.', 'Kepala Pusat Penilaian Pendidikan Kemendikbud, Nizam, mengatakan siswa untuk tidak takut menghadapi UN. Saat ini UN bukan penentu kelulusan. UN hanya digunakan sebagai alat ukur pencapaian siswa. Pihak yang menentukan kelulusan adalah sekolah. Informasi tersebut disampaikan Nizam dalam program â€œTrending Topik Metro TVâ€, Kamis (29/1/2015)', '', '', '', '', '', '5', 1, 'A', 'Y', '', ''),
