(1081, 'MN-3-C', 'PTS_B-Indonesia_XII', 1, '', '', 16, '', '', '', '', 'BindoPAS1216.PNG', 'Besar harapan saya dapat diterima di perusahaan yang Bapak pimpin. Atas perhatian Bapak, saya ucapkan terima kasih.', 'Besar harapanku dapat diterima di perusahaan yang Kamu pimpin. Atas kebaikan Kamu, saya ucapkan beribu-ribu terima kasih.', 'Besar harapan saya dapat diterima di perusahaan yang Bapak pimpin. Atas kebaikannya saya haturkan terima kasih.', 'Saya sangat berharap besar dapat diterima di perusahaan yang Bapak pimpin. Atas perhatianya, saya ucapkan terima kasih.', 'Saya sangat berharap besar dapat diterima di perusahaan yang Bapak pimpin. Atas kebaikan Bapak, saya ucapkan terima kasih.', '', '', '', '', '', '1', 1, 'A', 'Y', '', ''),
