(1083, 'MN-3-C', 'PTS_B-Indonesia_XII', 1, '', '', 18, '', '', '', '', 'BindoPAS1218.PNG', 'Atas perhatiannya Bapak/ Ibu, saya sampaikan terima kasih.', 'Atas perhatian Bapak/ Ibu, kami sampaikan terima kasih.', 'Atas perhatian Bapak/ Ibu, saya menyampaikan terima kasih.', 'Atas perhatiannya, saya menyampaikan terima kasih.', 'Atas perhatian Bapak/ Ibu disampaikan terima kasih.', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
