(1087, 'MN-3-C', 'PTS_B-Indonesia_XII', 1, '', '', 22, '', 'Bagian kalimat surat yang menyatakan kualifikasi adalah â€¦.', '', '', '', 'saya berharap bisa mendapat kesempatan untuk wawancara ', 'saya telah membaca iklan lowongan kerja ini lada tanggal 11 Oktober 2017 yang menyatakan bahwa perusahaan bapak/ibu membutuhkan ...', 'dengan ini saya mengajukan lamaran untuk jabatan sekretaris', 'atas perhatian bapak/ibu, saya ucapkan terima kasih', 'saya lulusan SMK Sekretaris tahun 2017, menguasai Ms. Office, mampu berbahasa Inggris aktif.....', '', '', '', '', '', '5', 1, 'A', 'Y', '', ''),
(1088, 'MN-3-C', 'PTS_B-Indonesia_XII', 1, '', '', 23, '', 'Surat lamaran pekerjaan yang anda susun termasuk jenis surat â€¦.', '', '', '', 'resmi', 'dinas', 'resmi pribadi', 'keluarga', 'pribadi', '', '', '', '', '', '1', 1, 'A', 'Y', '', ''),
(1089, 'MN-3-C', 'PTS_B-Indonesia_XII', 1, '', '', 24, '', '', '', '', 'BindoPAS1224.PNG', 'Dengan hormat, saya mengharapkan bapak menerima lamaran pekerjaan ini', 'Dengan hormat, iklan tersebut tidak disebarluaskan sehingga saya tidak tahu', 'Dengan hormat, setelah saya membaca lowongan pekerjaan tersebut, saya merasa memenuhi persyaratan tersebut', 'Dengan hormat, setelah saya membaca iklan lowongan tersebut, saya kirimkan syarat-syaratnya', 'Dengan hormat, agroindustri memang pekerjaan kesenangan saya, oleh karena itu, iklan ini sangat baik', '', '', '', '', '', '3', 1, 'A', 'Y', '', ''),
(1090, 'MN-3-C', 'PTS_B-Indonesia_XII', 1, '', '', 25, '', 'Apa yang dimaksud dengan surat lamaran pekerjaan?', '', '', '', 'Surat yang dibuat oleh seseorang untuk dapat memperoleh pekerjaan', 'Surat yang dibuat oleh orang lain untuk dapat kerja', 'Surat yang dibuat sendiri untuk masuk kerja', 'Surat yang dibuat orang tua untuk perusahaan', 'Surat perusahaan untuk pelamar', '', '', '', '', '', '1', 1, 'A', 'Y', '', '');
